pragma solidity ^0.4.24;

import "./fronts_mp.sol";

contract products_mp is fronts_mp {
////////////////////////////////// Products ////////////////////////////////////
    struct Product {
        //uint front_id;
        string name;
        string category;
        string description;
        uint unit_price;
        uint quantity;
        string image_link_ipfs;      //IPFS Image link
        bool isDeleted;
    }
    //mapping from store_owner => Storefront => Product
    mapping (address => mapping(uint => mapping(uint => Product))) products;
    mapping (address => mapping(uint => uint)) productCount;
    
    //Event when inserted new product
    event NewProductInserted(address store_owner, string storefront_name, string product_name, string category,
        string description, uint unit_price, uint quantity, string image_link_ipfs);
    //Event for empty product name
    event EmptyProductName(address store_owner, string storefront_name);
    //event for UpdateProduct
    event ProductUpdate(address store_owner, string storefront_name, string product_name,
        string description, uint unit_price, uint quantity, string image_link_ipfs);
    //Log product doesn't exist
    event LogProductNotExist(address store_owner, string storefront_name, string product_name);        
    //Log Delete product
    event LogDeleteProduct(address store_owner, string storefront_name, string product_name);
    
    //Thinking that fronts count and products count will be loop in front-end to Get Call Smart Contract
    function InsertProduct(uint _front_id, string _name, string _category, string _description, 
        uint _unit_price, uint _quantity, string _image_link_ipfs) public onlyStoreOwner whenNotPaused
    {
        //Make sure store owner is valid and approved
        require(store_owners[msg.sender].isApproved == true);
        //Check for empty product name
        //if(library_mp.IsEmptyString(_name))
        if(IsEmptyString(_name))
        {
            emit EmptyProductName(msg.sender, fronts[msg.sender][_front_id].front_name);
            return;
        }

        products[msg.sender][_front_id][productCount[msg.sender][_front_id]++] =
        Product(_name, _description, _category, _unit_price, _quantity, _image_link_ipfs, false);
        
        emit NewProductInserted(msg.sender, fronts[msg.sender][_front_id].front_name, _name, _category,
            _description, _unit_price, _quantity, _image_link_ipfs);
    }

    function UpdateProduct(uint _front_id, uint _product_id, string _front_name, string _name, 
        string _description, uint _unit_price, uint _quantity, string _image_link_ipfs) public onlyStoreOwner {
            //Make sure store owner is valid and approved
            require(store_owners[msg.sender].isApproved == true);
            //Count Product count should not be 0
            require(productCount[msg.sender][_front_id] != 0);
            //Check if the record exist. Empty Name string means doesn't exist
            /*
            if(IsEmptyString(store_front_products[msg.sender][_front_id][_product_id].name))
            {
                emit LogProductNotExist(msg.sender, _front_name, _name);
                return;
            }
            */
            products[msg.sender][_front_id][_product_id].name = _name;
            products[msg.sender][_front_id][_product_id].description = _description;
            products[msg.sender][_front_id][_product_id].unit_price = _unit_price;
            products[msg.sender][_front_id][_product_id].quantity = _quantity;
            products[msg.sender][_front_id][_product_id].image_link_ipfs = _image_link_ipfs;
            
            emit ProductUpdate(msg.sender, _front_name, _name,
                _description, _unit_price, _quantity, _image_link_ipfs);
    }
    function RemoveProduct(uint _front_id, uint _product_id) public onlyStoreOwner whenNotPaused  {
        //Make sure store owner is valid and approved
        require(store_owners[msg.sender].isApproved == true);
        require(productCount[msg.sender][_front_id] != 0);
        products[msg.sender][_front_id][_product_id].isDeleted = true;
        
        emit LogDeleteProduct(msg.sender, fronts[msg.sender][_front_id].front_name, 
            products[msg.sender][_front_id][_product_id].name);
        //read the site https://medium.com/@robhitchens/solidity-crud-part-2-ed8d8b4f74ec
    }
    function GetProductCountByFront(uint _front_id) public constant onlyStoreOwner returns(uint) {
        return productCount[msg.sender][_front_id];
    }
    //Get Storefront by address and array index
    function GetProductByFront(uint _front_id, uint _product_id) public 
        view onlyStoreOwner returns(string, string, string, uint, uint, string)
    {
        //if products exist
        //assert(library_mp.IsEmptyString(products[msg.sender][_front_id][_product_id].name)==false);
        assert(IsEmptyString(products[msg.sender][_front_id][_product_id].name)==false);
        if(products[msg.sender][_front_id][_product_id].isDeleted) {
            //Due to stack too deep error and eth limiation, 
            //I had not to return one bool variable and instead use if else condition
            return("","","",0,0,"");
        }
        else    {
            return(products[msg.sender][_front_id][_product_id].name,
                    products[msg.sender][_front_id][_product_id].category,
                    products[msg.sender][_front_id][_product_id].description,
                    products[msg.sender][_front_id][_product_id].unit_price,
                    products[msg.sender][_front_id][_product_id].quantity,
                    products[msg.sender][_front_id][_product_id].image_link_ipfs);
        }
    }
    function GetEachProductByOwner(address _storeOwnerAddress, uint _front_id, uint _product_id) public view
        returns(string, string, string, uint, uint, string)
    {
        assert(_storeOwnerAddress!=address(0));
        require(store_owners[_storeOwnerAddress].flag);
        assert(IsEmptyString(products[msg.sender][_front_id][_product_id].name)==false);
        if(products[msg.sender][_front_id][_product_id].isDeleted)    
            return("","","",0,0,"");
        else
            return(products[msg.sender][_front_id][_product_id].name,
                    products[msg.sender][_front_id][_product_id].category,
                    products[msg.sender][_front_id][_product_id].description,
                    products[msg.sender][_front_id][_product_id].unit_price,
                    products[msg.sender][_front_id][_product_id].quantity,
                    products[msg.sender][_front_id][_product_id].image_link_ipfs);
    }
////////////////////////////////////////////////////////////////////////////////
}
